import axios from 'axios';

const URL_API_BASE_URL = 'http://localhost:5000/url';

class UrlService {
  getUrls() {
    return axios.get(URL_API_BASE_URL);
  }

  createUrl(url) {
    return axios.post(URL_API_BASE_URL, url);
  }

  getUrlByPathId(pathId) {
    return axios.get(URL_API_BASE_URL + '/' + pathId);
  }

  updateUrl(pathId) {
    return axios.put(URL_API_BASE_URL + '/' + pathId);
  }

  deleteUrl(pathId) {
    return axios.delete(URL_API_BASE_URL + '/' + pathId);
  }
}

export default new UrlService();
